{
    "openapi":"3.0.0",
    "info":{
      "description":"",
      "version":"1.0",
      "title":"Engage Digital API",
      "termsOfService":"https://developer.ringcentral.com"
    },
    "tags":[
      {
        "name":"Attachments"
      }
    ],
    "paths":{
      "/attachments":{
        "get":{
          "tags":[
            "Attachments"
          ],
          "summary":"Getting all attachments",
          "operationId":"getAllAttachments",
          "description":"This method renders attachments ordered by creation date (descending).",
          "parameters":[
            {
              "name":"offset",
              "in":"query",
              "description":"The record index to start. Default value is 0.",
              "required":false,
              "schema":{
                "type":"integer",
                "format":"int32"
              }
            },
            {
              "name":"limit",
              "in":"query",
              "description":"The max number of records to return. Default value is 30, max value is 150.",
              "required":false,
              "schema":{
                "type":"integer",
                "format":"int32"
              }
            }
          ],
          "responses":{
            "200":{
              "description":"Success",
              "content":{
                "application/json":{
                  "schema":{
                    "$ref":"#/components/schemas/GetAllAttachmentsResponse"
                  }
                }
              }
            }
          }
        },
        "post":{
          "tags":[
            "Attachments"
          ],
          "summary":"Creating an attachment",
          "operationId":"createAttachment",
          "description":"This method allows you to create an new attachment.",
          "requestBody":{
            "content":{
              "multipart/form-data:":{
                "schema":{
                  "properties":{
                    "file":{
                      "type":"string",
                      "format":"binary"
                    },
                    "private":{
                      "type":"string",
                      "enum":["true","=1"]
                    }
                  }
                }
              }
            }
          },
          "responses":{
            "200":{
              "description":"Success",
              "content":{
                "application/json":{
                  "schema":{
                    "$ref":"#/components/schemas/Attachment"
                  }
                }
              }
            },
            "422":{
              "description":"Compose is not supported on this source (compose_disabled_on_source)"
            }
          }
        }
      },
      "/attachments/{attachmentId}":{
        "get":{
          "tags":[
            "Attachments"
          ],
          "summary":"Getting an attachment from its id",
          "operationId":"getAttachment",
          "description":"This method renders an attachment from given id.",
          "parameters":[
            {
              "name":"attachmentId",
              "in":"path",
              "required":true,
              "schema":{
                "type":"string"
              }
            }
          ],
          "responses":{
            "200":{
              "description":"Success",
              "content":{
                "application/json":{
                  "schema":{
                    "$ref":"#/components/schemas/Attachment"
                  }
                }
              }
            }
          }
        }
      }
    },
    "servers":[
      {
        "url":"https://DOMAIN.api.engagement.dimelo.com/1.0"
      }
    ],
    "components":{
      "securitySchemes":{
        "bearerAuth":{
          "type":"http",
          "scheme": "bearer"
        }
      },
      "schemas":{
        "GetAllAttachmentsResponse":{
          "properties":{
            "count":{
              "type":"integer",
              "format":"int32"
            },
            "limit":{
              "type":"integer",
              "format":"int32"
            },
            "offset":{
              "type":"integer",
              "format":"int32"
            },
            "records":{
              "type":"array",
              "items":{
                "$ref":"#/components/schemas/Attachment"
              }
            }
          }
        },
        "Attachment":{
          "properties":{
            "id":{
              "type":"string"
            },
            "created_at":{
              "type":"string",
              "format":"date-time"
            },
            "updated_at":{
              "type":"string",
              "format":"date-time"
            },
            "content_type":{
              "type":"string"
            },
            "filename":{
              "type":"string"
            },
            "foreign_id":{
              "type":"string"
            },
            "size":{
              "type":"integer"
            },
            "url":{
              "type":"string"
            },
            "video_metadata":{
              "type":"array",
              "items":{
                "type":"string"
              }
            },
            "embed":{
              "type":"boolean"
            },
            "public?":{
              "type":"boolean"
            }
          }
        }
      }
    }
  }
